// FichasCatalog - Cat√°logo de fichas de formaci√≥n
import React, { useState, useEffect } from 'react';
import { catalogAPI } from '../services/api.js';

const FichasCatalog = () => {
  const [fichas, setFichas] = useState([]);
  const [loading, setLoading] = useState(true);
  const [filters, setFilters] = useState({
    estado: '', // Cambiado de 'activa' a '' para mostrar todas por defecto
    jornada: '',
    programa: '',
    search: ''
  });
  const [selectedFicha, setSelectedFicha] = useState(null);
  const [students, setStudents] = useState([]);
  const [loadingStudents, setLoadingStudents] = useState(false);

  useEffect(() => {
    loadFichas();
  }, [filters.estado, filters.jornada, filters.programa, filters.search]);

  const loadFichas = async () => {
    try {
      setLoading(true);
      console.log('üîÑ [FichasCatalog] Cargando fichas con filtros:', filters);
      const result = await catalogAPI.getAllFichas(filters);
      console.log('üì• [FichasCatalog] Resultado recibido:', result);

      // Manejar diferentes formatos de respuesta
      let fichasData = [];

      if (result) {
        // Si la respuesta tiene success y data
        if (result.success !== undefined) {
          if (result.success) {
            fichasData = result.data || [];
          } else {
            console.error('‚ùå [FichasCatalog] Error en la respuesta:', result.message || result);
            fichasData = [];
          }
        } 
        // Si la respuesta es directamente un array
        else if (Array.isArray(result)) {
          fichasData = result;
        }
        // Si la respuesta tiene data directamente
        else if (result.data && Array.isArray(result.data)) {
          fichasData = result.data;
        }
        // Si la respuesta tiene un array en otra propiedad
        else if (result.fichas && Array.isArray(result.fichas)) {
          fichasData = result.fichas;
        }
      }

      console.log(`‚úÖ [FichasCatalog] ${fichasData.length} fichas cargadas`);
      if (fichasData.length > 0) {
        console.log('üìã [FichasCatalog] Primera ficha:', fichasData[0]);
      } else {
        console.warn('‚ö†Ô∏è  [FichasCatalog] No se encontraron fichas');
      }

      setFichas(fichasData);
    } catch (error) {
      console.error('‚ùå [FichasCatalog] Error cargando fichas:', error);
      console.error('‚ùå [FichasCatalog] Detalles del error:', error.response?.data || error.message);
      setFichas([]);
    } finally {
      setLoading(false);
    }
  };

  const handleFilterChange = (key, value) => {
    setFilters(prev => {
      const updated = { ...prev, [key]: value };
      return updated;
    });
  };

  const handleFichaClick = async (ficha) => {
    setSelectedFicha(ficha);
    setLoadingStudents(true);
    try {
      const result = await catalogAPI.getStudentsByFicha(ficha.codigo_ficha);
      if (result.success) {
        setStudents(result.data || []);
      }
    } catch (error) {
      console.error('Error cargando estudiantes:', error);
    } finally {
      setLoadingStudents(false);
    }
  };

  const getEstadoColor = (estado) => {
    const colors = {
      activa: 'bg-green-100 text-green-700',
      finalizada: 'bg-gray-100 text-gray-700',
      cancelada: 'bg-red-100 text-red-700'
    };
    return colors[estado] || 'bg-gray-100 text-gray-700';
  };

  const getJornadaColor = (jornada) => {
    const colors = {
      diurna: 'bg-blue-100 text-blue-700',
      nocturna: 'bg-purple-100 text-purple-700',
      mixta: 'bg-orange-100 text-orange-700'
    };
    return colors[jornada] || 'bg-gray-100 text-gray-700';
  };

  const formatDate = (date) => {
    if (!date) return 'N/A';
    return new Date(date).toLocaleDateString('es-CO');
  };

  return (
    <div className="min-h-screen bg-gray-50 p-6">
      <div className="max-w-7xl mx-auto">
        <div className="bg-white rounded-lg shadow-md p-6 mb-6">
          <h1 className="text-3xl font-bold text-gray-800 mb-6">
            üìã Cat√°logo de Fichas de Formaci√≥n - CBI Palmira
          </h1>

          {/* Filtros */}
          <div className="grid grid-cols-1 md:grid-cols-4 gap-4 mb-6">
            <div>
              <label className="block text-sm font-medium text-gray-700 mb-2">
                Estado
              </label>
              <select
                value={filters.estado}
                onChange={(e) => handleFilterChange('estado', e.target.value)}
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              >
                <option value="">Todos</option>
                <option value="activa">Activa</option>
                <option value="finalizada">Finalizada</option>
                <option value="cancelada">Cancelada</option>
              </select>
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700 mb-2">
                Jornada
              </label>
              <select
                value={filters.jornada}
                onChange={(e) => handleFilterChange('jornada', e.target.value)}
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              >
                <option value="">Todas</option>
                <option value="diurna">Diurna</option>
                <option value="nocturna">Nocturna</option>
                <option value="mixta">Mixta</option>
              </select>
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700 mb-2">
                Programa
              </label>
              <input
                type="text"
                value={filters.programa}
                onChange={(e) => handleFilterChange('programa', e.target.value)}
                placeholder="Buscar por programa..."
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              />
            </div>

            <div>
              <label className="block text-sm font-medium text-gray-700 mb-2">
                Buscar
              </label>
              <input
                type="text"
                value={filters.search}
                onChange={(e) => handleFilterChange('search', e.target.value)}
                placeholder="C√≥digo de ficha..."
                className="w-full px-3 py-2 border border-gray-300 rounded-md focus:outline-none focus:ring-2 focus:ring-blue-500"
              />
            </div>
          </div>

          {/* Lista de fichas */}
          {loading ? (
            <div className="text-center py-12">
              <div className="inline-block animate-spin rounded-full h-12 w-12 border-t-2 border-b-2 border-blue-500"></div>
              <p className="mt-4 text-gray-600">Cargando fichas...</p>
            </div>
          ) : (
            <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
              {fichas.map((ficha) => (
                <div
                  key={ficha.id_ficha}
                  className="border border-gray-200 rounded-lg p-4 hover:shadow-lg transition-shadow cursor-pointer"
                  onClick={() => handleFichaClick(ficha)}
                >
                  <div className="flex justify-between items-start mb-2">
                    <span className="text-lg font-bold text-blue-600 bg-blue-100 px-3 py-1 rounded">
                      {ficha.codigo_ficha}
                    </span>
                    <div className="flex gap-2">
                      <span className={`text-xs px-2 py-1 rounded ${getEstadoColor(ficha.estado)}`}>
                        {ficha.estado}
                      </span>
                      <span className={`text-xs px-2 py-1 rounded ${getJornadaColor(ficha.jornada)}`}>
                        {ficha.jornada}
                      </span>
                    </div>
                  </div>
                  <h3 className="font-semibold text-gray-800 mb-2">
                    {ficha.programa_formacion}
                  </h3>
                  {ficha.nombre_programa && (
                    <p className="text-sm text-gray-600 mb-2">
                      <span className="font-medium">Programa:</span> {ficha.nombre_programa}
                    </p>
                  )}
                  <div className="space-y-1 text-sm text-gray-600">
                    <p>
                      <span className="font-medium">Aprendices:</span> {ficha.aprendices_activos || ficha.numero_aprendices || 0}
                      {ficha.capacidad_maxima && ` / ${ficha.capacidad_maxima}`}
                    </p>
                    {ficha.codigo_ambiente && (
                      <p>
                        <span className="font-medium">Ambiente:</span> {ficha.codigo_ambiente} - {ficha.nombre_ambiente}
                      </p>
                    )}
                    {ficha.bloque && (
                      <p>
                        <span className="font-medium">Bloque:</span> {ficha.bloque}
                      </p>
                    )}
                    <p>
                      <span className="font-medium">Inicio:</span> {formatDate(ficha.fecha_inicio)}
                    </p>
                    {ficha.fecha_fin && (
                      <p>
                        <span className="font-medium">Fin:</span> {formatDate(ficha.fecha_fin)}
                      </p>
                    )}
                  </div>
                </div>
              ))}
            </div>
          )}

          {!loading && fichas.length === 0 && (
            <div className="text-center py-12 text-gray-500">
              No se encontraron fichas con los filtros seleccionados.
            </div>
          )}
        </div>

        {/* Panel de aprendices de la ficha seleccionada */}
        {selectedFicha && (
          <div className="bg-white rounded-lg shadow-md p-6 mt-6">
            <div className="flex justify-between items-center mb-4">
              <h2 className="text-2xl font-bold text-gray-800">
                Aprendices - Ficha {selectedFicha.codigo_ficha}
              </h2>
              <button
                onClick={() => {
                  setSelectedFicha(null);
                  setStudents([]);
                }}
                className="text-gray-500 hover:text-gray-700"
              >
                ‚úï
              </button>
            </div>

            <div className="mb-4 p-4 bg-gray-50 rounded-lg">
              <p className="text-sm text-gray-600">
                <span className="font-medium">Programa:</span> {selectedFicha.programa_formacion}
              </p>
              <p className="text-sm text-gray-600">
                <span className="font-medium">Jornada:</span> {selectedFicha.jornada}
              </p>
              <p className="text-sm text-gray-600">
                <span className="font-medium">Estado:</span> {selectedFicha.estado}
              </p>
            </div>

            {loadingStudents ? (
              <div className="text-center py-8">
                <div className="inline-block animate-spin rounded-full h-8 w-8 border-t-2 border-b-2 border-blue-500"></div>
              </div>
            ) : (
              <div className="overflow-x-auto">
                <table className="min-w-full divide-y divide-gray-200">
                  <thead className="bg-gray-50">
                    <tr>
                      <th className="px-4 py-3 text-left text-xs font-medium text-gray-500 uppercase">
                        Documento
                      </th>
                      <th className="px-4 py-3 text-left text-xs font-medium text-gray-500 uppercase">
                        Nombre
                      </th>
                      <th className="px-4 py-3 text-left text-xs font-medium text-gray-500 uppercase">
                        Estado
                      </th>
                      <th className="px-4 py-3 text-left text-xs font-medium text-gray-500 uppercase">
                        √öltimo Acceso
                      </th>
                      <th className="px-4 py-3 text-left text-xs font-medium text-gray-500 uppercase">
                        Accesos (30 d√≠as)
                      </th>
                    </tr>
                  </thead>
                  <tbody className="bg-white divide-y divide-gray-200">
                    {students.map((student) => (
                      <tr key={student.id_persona} className="hover:bg-gray-50">
                        <td className="px-4 py-3 text-sm text-gray-900">
                          {student.documento}
                        </td>
                        <td className="px-4 py-3 text-sm text-gray-900">
                          {student.nombre}
                        </td>
                        <td className="px-4 py-3 text-sm">
                          <span className={`px-2 py-1 rounded text-xs ${
                            student.estado === 'activo'
                              ? 'bg-green-100 text-green-700'
                              : 'bg-red-100 text-red-700'
                          }`}>
                            {student.estado}
                          </span>
                        </td>
                        <td className="px-4 py-3 text-sm text-gray-600">
                          {student.ultimo_acceso
                            ? new Date(student.ultimo_acceso).toLocaleDateString('es-CO')
                            : 'Nunca'}
                        </td>
                        <td className="px-4 py-3 text-sm text-gray-600">
                          {student.accesos_mes || 0}
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
                {students.length === 0 && (
                  <div className="text-center py-8 text-gray-500">
                    No hay aprendices registrados en esta ficha.
                  </div>
                )}
              </div>
            )}
          </div>
        )}
      </div>
    </div>
  );
};

